import React, { Component } from 'react';
import { HashRouter as Router, Route, Switch} from 'react-router-dom';
import { LinkContainer } from 'react-router-bootstrap';
import { Nav } from 'react-bootstrap';
import { Home } from "./Home";
import { About } from "./About";
import { Contact } from "./Contact";
import { NoMatch } from "./NoMatch";
import { Layout } from './components/Layout';
import {NavigationBar } from "./components/NavigationBar";

function App() {
  return (
    <React.Fragment>
      <NavigationBar />
      <Layout>
        <Router>
          <Switch>
            <RouterNavLink to="/"></RouterNavLink>
            <RouterNavLink to="/About"></RouterNavLink>
            <RouterNavLink to="/contact"></RouterNavLink>
            <RouterNavLink to="/nomatch"></RouterNavLink>

          </Switch>
        </Router>
      </Layout>

    </React.Fragment>
  );
}

const RouterNavLink = ({ children, ...props }) => (
  //This function courtesy of Parth Sarin
  <LinkContainer exact {...props}>
    <Nav.Link active={false}>
      {children}
    </Nav.Link>
  </LinkContainer>
)

export default App;
